    static class SolutionSelf {
        public String minWindow(String s, String t) {
            Map<Character, Integer> window = new HashMap<>();
            Map<Character, Integer> target = new HashMap<>();
            //map
            for (int i = 0; i < t.length(); i++) {
                char c = t.charAt(i);
                target.put(c,target.getOrDefault(c, 0)+ 1);
            }
            int left = 0, right = 0;
            int start = left;
            int minLength = Integer.MAX_VALUE;
            int count = 0;

            while (right < s.length()) {
                //
                char charRight = s.charAt(right);
                //twindow map
                if (target.containsKey(charRight)) {
                    window.put(charRight, window.getOrDefault(charRight, 0) + 1);
                    //tcount +1windowt
//                    if (window.get(charRight) == target.get(charRight)) {
//                        count++;
//                    }
                    if (window.get(charRight).equals(target.get(charRight))) {
                        count++;
                    }
                }
                //
                right++;

                //
                //twindow.size() == target.size()t
                //while(window.size() == target.size()){
                while (count == target.size()) {
                    //right-leftminLength
                    //minLength = Math.min(right-left, minLength);
                    if(right-left <minLength){
                        minLength = right-left;
                        start = left;
                    }
                    char charLeft = s.charAt(left);
                    //left++;
                    //tleft++
                    if(!target.containsKey(charLeft)){

                        left++;
                        //startleft++stright---leftt
                        //start = left;
                    }else {

                        //1t
//                        if(window.get(charLeft)==target.get(charLeft)){
//                            count--;
//                            //start = left;
//                        }
                        if(window.get(charLeft).equals(target.get(charLeft))){
                            count--;
                            //start = left;
                        }
                        //start = left;
                        left ++;
                        window.put(charLeft, window.get(charLeft) - 1);
                    }
                }
            }
            return minLength==Integer.MAX_VALUE?"":s.substring(start, start + minLength);
        }
    }

